import embeddablePlayerControls from './player-controls'
import tooltips from './tooltips'
import visualFeedback from './visual-feedback'

export { embeddablePlayerControls, tooltips, visualFeedback }

export default embeddablePlayerControls.concat(tooltips).concat(visualFeedback)
